description:
Our high energy seven piece rock outfit has been together since June 2011. Our music style ranges from soft rock to hard rock. We are inspired by artists like Poets of the Fall, Metallica, SOAD, Creed, Three Days Grace, Seether, Guns n Roses, Infected Mushroom, Bullet For My Valentine, Iron Maiden, Breaking Benjamin, Crossfade, Joe Satriani, Steve Vai, Slash and Bucket Head.


